from flask import Flask, jsonify, request
from flask_restful import Resource, Api
from requests import get
import json
import time
app=Flask(__name__)

api=Api(app)



def revGeocoding(lat,lo):
	url="http://apis.mapmyindia.com/advancedmaps/v1/1yrdaocz7jcdya1pizrjzu4a8kt3shls/rev_geocode?lat="+str(lat)+"&lng="+str(lo)
	r=get(url)
	a=r.json()['results']
	locality=a[0]['locality']
	# pincode is just for improvization
	pincode=a[0]['pincode']
	return locality

def policeStationDistance(lat, lo):
	url="https://atlas.mapmyindia.com/api/places/nearby/json?keywords=police$station&refLocation="+str(lat)+","+str(lo)
	r=get(url, headers={"Authorization":"bearer 26cc0519-6ca0-4b6e-b0f3-98b8d7d07912"})
	a=r.json()['suggestedLocations']
	distance=(a[0]['distance'])/1000
	return distance

def hospitalDistance(lat, lo):
	url="https://atlas.mapmyindia.com/api/places/nearby/json?keywords=hospital&refLocation="+str(lat)+","+str(lo)
	r=get(url, headers={"Authorization":"bearer 26cc0519-6ca0-4b6e-b0f3-98b8d7d07912"})
	a=r.json()['suggestedLocations']
	distance=(a[0]['distance'])/1000
	return distance

